import AvatarGuest from "./AvatarGuest";
import React from "react";
import Hiring from "./Hiring";
import Birth from "./Birth";
import { Grid, Box, Paper, makeStyles } from "@material-ui/core";
import progIcon from "./assets/prog.png";
import delintIcon from "./assets/HQ.png";
import situatIcon from "./assets/situat.png";
import trashIcon from "./assets/trash.png";
import "./style.css";

const useStyles = makeStyles({
  mainGrid: {
    display: "flex",
    flexDirection: "column",
    padding: "1.3rem 1rem",
  },
  gridItemName: {
    display: "flex",
    alignItems: "center",
  },
  paperName: {
    fontSize: "1rem",
    fontWeight: 700,
    margin: "0 1.3rem",
  },
  gridItemPos: {
    display: "flex",
    alignItems: "center",
    margin: "0.6rem 0 1.3rem",
    paddingLeft: "0.3rem",
  },
  paperPos: {
    marginLeft: "0.6rem",
    fontSize: "0.8rem",
    fontWeight: 400,
    color: "lightgrey",
  },
});

function Guest() {
  const classes = useStyles();
  return (
    <Grid className={classes.mainGrid}>
      <Grid item className={classes.gridItemName}>
        <AvatarGuest />
        <Paper className={classes.paperName}>Sofia O'Sullivan</Paper>
        <Box className="trash">
          <img src={trashIcon} alt="trash" />
        </Box>
      </Grid>
      <Grid item className={classes.gridItemPos}>
        <img src={progIcon} alt="programmer" />
        <Paper className={classes.paperPos}>Programmer</Paper>
        <Paper className="mx-3">|</Paper>
        <img src={delintIcon} alt="del" />
        <Paper className={classes.paperPos}>Delinternet HQ</Paper>
      </Grid>
      <Hiring />
      <div className="my-3">
        <Birth />
      </div>
      <Grid item>
        <Box className="d-flex align-items-center">
          <img className="ms-1 me-3" src={situatIcon} alt="situation" />
          <Paper className="hiring mb-0">Current situation</Paper>
        </Box>
        <Paper className="work">Work in progress</Paper>
      </Grid>
    </Grid>
  );
}

export default Guest;
